import React, { Component } from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { withStyles } from '@material-ui/core/styles';
import Divider from '@material-ui/core/Divider';

const useStyles = theme => ({
    card:{
        padding:10,
        minWidth:100
    },
    titleCard:{
        fontSize:'0.2em',
        textAlign:'center'
    },

  });
class Top5 extends Component {

    render() {
        const {classes} = this.props;
        const top5_=this.props.top5.map(state_data=>


        <Box p={1} >
        <div key={state_data.States}>

        <Card className={classes.card}>
            <CardContent className={classes.titleCard}>
            <Typography variant="h5" component="h1">
                {state_data.States}
                </Typography>


            </CardContent>

            <Divider light />
            <Box display={'flex'}>
                <Box p={3} flex={'auto'} >
                <Typography color="textSecondary">
                    Confirmed
                </Typography>
                <Typography variant="h5" component="h2">
                {state_data.Confirmed}
                </Typography>
                </Box>
                <Box p={3} flex={'auto'} >
                <Typography color="textSecondary">
                        Cured
                </Typography>
                <Typography variant="h5" component="h2">
                {state_data.Cured}
                </Typography>
                </Box>
                <Box p={3} flex={'auto'} >
                <Typography color="textSecondary">
                        Deaths
                </Typography>
                <Typography variant="h5" component="h2">
                {state_data.Deaths}
                </Typography>
                </Box>
            </Box>
        </Card>
        </div>
        </Box>






        );
        return (
            <div>
                <Box flexWrap="wrap" display="flex" justifyContent="center" alignItems="center" m={2} p={5} >
                {top5_}
                </Box>
            </div>
        );
    }
}

export default withStyles(useStyles)(Top5);
